import Object = require('nashorn/java/lang/Object');

declare class Trinity<A, B, C> extends Object {
	first : A;
	second : B;
	third : C;
	constructor(arg1 : A, arg2 : B, arg3 : C);
	getFirst() : A;
	getSecond() : B;
	getThird() : C;
	static create<A, B, C>(arg1 : A, arg2 : B, arg3 : C) : Trinity<A, B, C>;
	static hashCode(arg1 : Object) : number;
}

export = Trinity
